import { Button, Card } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'

const Header = () => {
  return (
    <Card>
        <Link to={"/chats"}>
            <Button>Chats</Button>
        </Link>
    </Card>
  )
}

export default Header
